import Container from 'react-bootstrap/Container';
import Jumbotron from 'react-bootstrap/Jumbotron';
import '../Styles/Home.css';
const Home = () => (


<Jumbotron fluid = {true}>
  <Container>
  <h1 className="homeText"> I am, Karishma, </h1>
    <h3 className="homeText">Front-End Developer, based in New York</h3>
  </Container>
</Jumbotron>

)

export default Home;
